var map = L.map('mapdiv').setView([48.95024, 2.24447], 14);

L.tileLayer('http://{s}.tile.osm.org/{z}/{x}/{y}.png', {
    attribution: '&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
}).addTo(map);


// control that shows state info on hover
var info = L.control();

info.onAdd = function (map) {
	this._div = L.DomUtil.create('div', 'info');
	this.update();
	return this._div;
};

info.update = function (propert) {
	this._div.innerHTML = '<h4>Vote François Hollande</h4>' +  (propert ?
		'<b>' + propert.name + '</b><br />' + propert.suffrages + ' votes sur ' + propert.electeurs + ' électeurs <br />' + propert.density + ' % des inscrits'
		: 'Passez la souris sur un bureau de vote');
};

info.addTo(map);

var legend = L.control({position: 'bottomright'});

legend.onAdd = function (map) {

	var div = L.DomUtil.create('div', 'info legend'),
		grades = [0, 20, 25, 30, 35],
		labels = [],
		from, to;

	for (var i = 0; i < grades.length; i++) {
		from = grades[i];
		to = grades[i + 1];

		labels.push(
			'<i style="background:' + getColorps(from + 1) + '"></i> ' +
			from + (to ? '&ndash;' + to : '+'));
	}

	div.innerHTML = labels.join('<br>');
	return div;
};

legend.addTo(map);


function getColorps(d) {
	return d > 35 ? '#C03B3C' :
	       d > 30  ? '#FF4F51' :
	       d > 25  ? '#FF7372' :
	       d > 20  ? '#FF9595':
	                  '#FFB9B9';
}

function styleps(feature) {
	return {
		weight: 0.5,
		opacity: 1,
		color: 'black',
		fillOpacity: 0.5,
		fillColor: getColorps(feature.propert.density)
	};
}

function animFeature(e) {
	var layer = e.target;

	layer.setStyle({
		weight: 2,
		color: 'black',
		dashArray: '',
		fillOpacity: 0.8
	});

	if (!L.Browser.ie && !L.Browser.opera) {
		layer.bringToFront();
	}

	info.update(layer.feature.propert);
}

var geojsonps;

function resetHighlight(e) {
	geojsonps.resetStyle(e.target);
	info.update();
}

function zoomToFeature(e) {
	map.fitBounds(e.target.getBounds());
}

function onEachFeature(feature, layer) {
	layer.on({
		mouseover: animFeature,
		mouseout: resetHighlight,
		click: zoomToFeature
	});
}

geojsonps = L.geoJson(bureaups, {
	style: styleps,
	onEachFeature: onEachFeature
}).addTo(map);

map.attributionControl.addAttribution('Population data &copy; <a href="http://www.argenteuil.fr/">Mairie d\'Argenteuil</a>');


var popup = L.popup();

function onMapClick(e) {
    popup
        .setLatLng(e.latlng)
        .setContent("You clicked the map at " + e.latlng.toString())
        .openOn(map);
}

map.on('click', onMapClick);
